require 'rails_helper'

RSpec.describe PendingMedicationsController, type: :controller do

  before do
    PendingMedication.delete_all
    @user = create(:user)
    @user.save!
    @pending_medications = build_list(:pending_medication, 3, user: @user)
    @pending_medications.each do |p|
      p.status = 'new'
      p.save!
    end
  end

  describe "index" do
    it "should return all the pending medications" do
      login_with @user

      get :index
      expect(response.status).to eq(200)
      json = JSON.parse(response.body)
      expect(json.length).to eq(3)

      # test the json render
      expect(json[0]['createdAt']).not_to be(nil)
    end
  end


  describe "create" do
    it "should create a pending medication" do
      login_with @user

      post :create, {
        pending_medication: {
          status: "hello",
          images: ['']
        }
      }

      expect(response.status).to eq(201)

      json = JSON.parse(response.body)

      expect(PendingMedication.count).to eq(4)
      pm = PendingMedication.find_by(id: json['id'])
      expect(pm.user_id).to eq(@user.id)
    end

  end

  describe "create_med_or_refill" do
    before do
      Medication.destroy_all
      RefillInfo.destroy_all
      PendingMedication.destroy_all
      RefillInfo.destroy_all
      @pending_med = create(:pending_medication)
      @pending_med.status = 'new'
      @pending_med.save
    end

    it "should create a med and refill" do
      expect(Medication.count).to eq(0)
      expect(RefillInfo.count).to eq(0)
      job_count = Delayed::Job.count

      login_with @user

      post :create_med_or_refill, {
        pending_med_id: @pending_med.id,
        medication: {
          "user_id"=>@user.id,
          "name"=>"VALTREX",
          "dose"=>"1",
          "frequency"=>"once daily",
          "strength"=>"1mg",
          "form"=>"Tablets",
          "count"=>30,
          "route"=>"By mouth",
          "category"=>"Rx Medication",
          "instructions"=>"take it",
          "ndc"=>"123-456",
          "refill"=> {
            "rx_number"=>"abc123",
            "rx_fill_date"=>"2016-01-01T05:00:00.000Z",
            "refill_num"=>1,
            "refill_total"=>3,
            "current_med_count"=>30,
            "days_supply"=>30,
            "discard_date"=>"2017-01-01T05:00:00.000Z",
            "refills_expiration"=>"2016-05-20T04:00:00.000Z",
            "active_refill"=>true
          },
          "pharmacy_id"=>1366551665,
          "prescriber_id"=>1083004337
        }
      }

      expect(response.status).to eq(201)

      json = JSON.parse(response.body)
      expect(Medication.count).to eq(1)
      expect(RefillInfo.count).to eq(1)
      expect(PendingMedication.count).to eq(1)
      g = Medication.find_by(id: json['id'])
      expect(g.name).to eq("VALTREX")
      expect(g.refills.count).to eq(1)
      expect(g.active_refill).to_not be_nil
      expect(g.active_refill.refill_num).to eq(1)
      expect(Delayed::Job.count).to eq(1 + job_count)
    end

    it "should create just the refill" do
      @medication = create(:medication, user: @user, count: 5)
      @medication.save!
      expect(PendingMedication.count).to eq(1)
      expect(Medication.count).to eq(1)
      expect(Medication.first.count).to eq(5)
      expect(RefillInfo.count).to eq(0)

      login_with @user

      post :create_med_or_refill, {
        pending_med_id: @pending_med.id,
        medication: {
          id: @medication.id,
          name: @medication.name,
          user_id: @user.id,
          refill: {
            refill_num: 1,
            refill_total: 3,
            current_med_count: 30,
            days_supply: 30
          }
        }
      }

      expect(response.status).to eq(201)

      json = JSON.parse(response.body)
      expect(Medication.count).to eq(1)
      expect(Medication.first.count).to eq(35)
      expect(RefillInfo.count).to eq(1)
    end
  end

  describe "show" do
    it "should return a single pending medication" do
      login_with @user

      get :show, id: @pending_medications[0].id
      expect(response.status).to eq(200)
      json = JSON.parse(response.body)
      expect(json['id']).to eq(@pending_medications[0].id)
    end
  end

  describe "image" do
    it "should return an image as a PNG" do
      login_with @user

      PendingMedication.delete_all

      post :create, {
        pending_medication: {
          images: ['']
        }
      }

      expect(PendingMedication.first.images[0]).to eq('')
    end

  end
end
